function todaydateFunction() {
        var date = new Date();
        var day = date.getDate();
        var month = date.getMonth() + 1;
        var year = date.getFullYear();
        if (month < 10) month = "0" + month;
        if (day < 10) day = "0" + day;
        var today = year + "-" + month + "-" + day;   
         return today; 

         }  
  function yesterdaydateFunction(){    
  var date = new Date();   
        date.setDate(date.getDate() - 1);
        var day = date.getDate();
        var month = date.getMonth() + 1;
        var year = date.getFullYear();
        if (month < 10) month = "0" + month;
        if (day < 10) day = "0" + day;
        var yesterday = year + "-" + month + "-" + day;
        return yesterday;
        
        }


 function report(from,to){
          var selected = [];
 // alert('hello');

$('#checkboxes input:checked').each(function() {
    selected.push($(this).attr('value'));
});
selected.push('date');

var obj = {};

for(i in selected){
  var newNum = selected[i];
  var newVal = 1;
  obj[newNum] = newVal;
}
//alert(selected);
var x=JSON.stringify(obj);
var dataset=[];
for(i=0;i<selected.length;i++)
{
dataset[i]={title:selected[i].charAt(0).toUpperCase()+selected[i].slice(1) ,dataKey:selected[i]};
}
//alert(JSON.stringify(dataset));
$.post("/datereport",{"selectedarray":x,"selected":selected,"from":from,"to":to}).done(function(data, textStatus, jqXHR){
//alert(JSON.stringify(data));
var columns = dataset;
    var rows = data;
    var fromx=moment(from).format('DD-MM-YYYY');
    var tox=moment(to).format('DD-MM-YYYY');
    var pdfsize = 'a2';
   var doc = new jsPDF('p', 'pt' , pdfsize);
    var aditya = 'data:image/png;base64,';
    doc.addImage(aditya,'jpg',40,10,120,60);
 var myhub = 'data:image/png;base64,';
    doc.addImage(myhub,'jpg',1000,10,120,60);
     var thub = 'data:image/png;base64,';
    doc.addImage(thub,'jpg',1150,1650,20,30);
     doc.text(1050,1670,"Powered by");
    doc.setFontSize(20);
    doc.setFontStyle('bolditalic');
    doc.setFontType('sans-serif');
    doc.setTextColor('');
    doc.text(500,40,"ATTENDANCE REPORT");
    doc.setFontSize(15);
    doc.text(600,70,fromx+" : "+tox);
    doc.setLineWidth(1.5);
    doc.line(40,80,1165,80);
    // doc.text(500,30,"From:"+from+"  to:"+to);
    doc.autoTable(columns, rows,{theme:'grid',startY:120,showHeader: 'everyPage',headerstyles:{fillColor:20},columnStyles: {fontSize: 5},alternateRowStyles: {fillColor:200}});
    
    doc.save('T-hub'+from+'-'+to+'-AttendanceReport.pdf');
    var pdf = doc.output('blob');

var data = new FormData();

data.append('data' , pdf);
//alert(from);
data.append('from',from);
data.append('to',to);
var xhr = new XMLHttpRequest();
xhr.onreadystatechange = function() {
  if (this.readyState == 4) {
    if (this.status !== 200) {
      // handle error
    }
  }
}

xhr.open('POST', '/upload', true);
xhr.send(data);


});

return (1);
        }

function display(val)
{

$.post("/dbdata",{"idcard":val}).done(function(data, textStatus, jqXHR) {
var obj=JSON.stringify(data);
var da=jQuery.parseJSON(obj);

if(da.error){
$("#idcard").val("");
$("#name").text("");
$("#rollno").text("");
$("#dept").text("");
$("#section").text("");
$("#year").text("");
$("#email").text("");
$("#college").text("");
$("#imgpath").attr("src","user-icon.png");
$("#status").text(da.error);
}
else
{
$("#name").text(da.name);
$("#rollno").text(da.rollno);
$("#dept").text(da.dept);
$("#section").text(da.section);
$("#year").text(da.year);
$("#email").text(da.email);
$("#college").text(da.college);
$("#imgpath").attr("src","images/"+da.rollno+".jpg");
$("#idcard").val("");
$("#status").text("details  found");
}
}).fail(function(jqXHR, textStatus, errorThrown) 
{

    alert('failed');
});

}
